import { CborNegInt, CborUInt, CborBytes, CborText, CborSimple } from "../CborObj/index.js";
import { LazyCborArray } from "./LazyCborArray.js";
import { LazyCborMap } from "./LazyCborMap.js";
import { LazyCborTag } from "./LazyCborTag.js";
export type LazyCborObj = CborNegInt | CborUInt | CborBytes | CborText | LazyCborArray | LazyCborMap | LazyCborTag | CborSimple;
export declare function isLazyCborObj<T extends object>(cborObj: T): cborObj is (T & LazyCborObj);
